import React, { Component } from 'react';
import TopNav from '../TopNav/TopNav';

import './App.scss';

class App extends Component {
  render() {
    return (
      <div className="App">
        <TopNav />
        <BottomNav />
        hello
      </div>
    );
  }
}

export default App;
